import Form from 'react-bootstrap/Form';

function CustomFormCheck() {
    return (
        <Form>
            <div key={`reverse-checkbox`} className="mb-3">
                <Form.Check
                    reverse
                    label="1"
                    name="group1"
                    type={'checkbox'}
                    id={`reverse-checkbox-1`}
                />
                <Form.Check
                    reverse
                    label="2"
                    name="group1"
                    type={'checkbox'}
                    id={`reverse-checkbox-2`}
                />
                <Form.Check
                    reverse
                    disabled
                    label="3 (disabled)"
                    type={'checkbox'}
                    id={`reverse-checkbox-3`}
                />
            </div>
        </Form>
    );
}

export default CustomFormCheck;
